Text:
@RH
Thanks! Been waiting for awhile and it works great on my PC... However, I have tried it on my laptop PC, and my wifes desktop PC and after installing the NTR, Norton immediately pops up and claims everything is turning off(Firewall, anti-virus/spy/etc, etc..), and when I open NIS, the dashboard is all greyed out and it has BIG X and says "Subscription Required - If you do not subscribe now, your PC will remain unprotected. Purchasing a subscription is less than a minute."

Just letting you know, but nonetheless... It works G-R-E-A-T on the PC I use most of the time. THANK YOU!!!! Keep up the good work.

@RH

Also my good man, do you know of anywhere I can find a direct download for NIS 17.6.0.32? Because every time I try NTR and fail, I have to uninstall, reinstall 17.5.0.127 and update to 17.6.0.32.

Just wondering, thanks a mighty lot.  :)
